const numero = document.querySelector('#numero');
const boton = document.querySelector('#btn');
const boton2 = document.querySelector('#btn2');
const titulo = document.querySelector('#titulo');
const cerebro = document.querySelector('#cerebro');

let numeroDescifrar = 0;
boton.addEventListener('click', function () {
    numeroDescifrar = parseInt(Math.random() * 100);
    titulo.innerHTML = `Ya puedes adivinar el numero, intentalo ingresando un valor`
    boton2.removeAttribute('disabled')
    boton.setAttribute('disabled', 'true');
    console.log(numeroDescifrar);
})

let intentos = 1;
boton2.addEventListener('click', function () {
    if (intentos != 5) {
        if (numero.value == numeroDescifrar) {
            titulo.innerHTML = `Genial has adivinado! , el numero era ${numeroDescifrar} lo adivinaste en ${intentos} intentos`;
            cerebro.src = `data:image/jpeg;base64,`
            boton.removeAttribute('disabled')
            boton2.setAttribute('disabled', 'true');
        } else {
            if (numero.value > numeroDescifrar) {
                titulo.innerHTML = "Intentalo con un numero mas chico";
                cerebro.src = 'data:image/png;base64,'
                intentos++;
            } else {
                titulo.innerHTML = "Intentalo con un numero mas grande";
                cerebro.src = 'data:image/png;base64,'
                intentos++;
            }
        }
    } else {
        titulo.innerHTML = `Lo siento has agotado los  ${intentos} intentos`
        intentos = 1;
        boton.removeAttribute('disabled')
        boton2.setAttribute('disabled', 'true');
    }
})

